ses_head:"¿Son estos las mismas cajas que Valve ofrece?",faq_valve_cases_body:"No, adicionamos skins nosotros mismos a ofrecer aberturas de cajas que son más gratificantes y más divertidas para abrir do que Valve o cualquier otro sitio ofrece.",faq_withdraw_status_head:"¿Dónde puedo seguir el estado de mi solicitud de retirada?",faq_withdraw_status_body:"Solicitud de retiradas pueden ser rastreadas en la pestaña de histórico, en el menú principal. Clic en la pestaña de la história del comercio siguiente. Esto mostrará una listad e todas sus operaciones y sus estados.",faq_open_cases_head:"¿Cómo puedo abrir las cajas en csgolive?",faq_open_cases_body:'Clic en depósito en el menú de la izquierda y use G2APAY para pagar en dinero, o use SKFPAY para pagar con skins. Después, vaya a cualquier caja que puede pagar y clic en "Abrir Caja"!',faq_skin_colors_head:"¿Que san esas colores que rodean las skins y por qué son diferentes a cómo las colorea Valve?",faq_skin_colors_body:"Las colores que aparecen se basan en el valor de la skin en relación con el precio de la caja que se encuentra. Así que una skin con un borde amarillo se valora mucho más que el precio de la caja que se encuentra.",faq_skin_wears_head:"¿Por qué no tienes todos los estados de skins (por ejemplo Bayoneta ? | Pátina Urbana Recién Fabricada)? Y por qué son algunas skins con desgaste minimo o probadas en campo con una tasa más baja que las versiones recién fabricadas?",faq_skin_wears_body:"No todos estados de skins están disponibles y si son, podrían ser muy poco frecuente y difícil de obtener. Por lo que ofrecemos lo que las skins son fáciles de volver a llenar y tratar de hacer las probabilidades como diversión para el usuario como sea posible..",faq_case_creator_head:"¿Cómo funciona el creador de cajas?",faq_case_creator_body:"En el creador de cajas, puedes elegir las skins y las probabilidades que desee en su caja. Fijamos el precio de forma automatica usando estadísticas simples y valor esperado. Puede añadir una tasa a su caja y vincularla a otras para sacar ganancias de su caja. Le mostramos las cajas abiertas más abiertas en la página principal y en el navegador de cajas. Tambiém puede presentar su caja durante 24 horas mediante el pago de una cuota de $10. Esto pondrá su caja en nuestra página principal y en la sección de navegador de cajas, nas cajas destacadas",faq_rigged_head:"¿Su sitio es manipulado?",faq_rigged_body:"Las probabilidades de nuestras cajas son grandes y mejores que cualquier otro sitio de apertura de cajas. Además, si no te gusta las probabilidades en nuestras cajas, no dude en utilizar la función de creador de cajas para hacer sus proprias cajas y abrirlas!",faq_restock_head:"¿Qué significa si un item no está disponible o tiene que ser re-abastecido?",faq_restock_body:"Esto significa que este item no está disponible en este momento. Nos re-llenar nuestros items cada 2-3 horas y hacemos todo lo posible para mantener un inventario abastecido. Si no quiere esperar para una re-acciones siempre se puede retirar a skfpay y retirar un equivalente en el almacén..",faq_deposit_before_withdraw_head:"¿Es necesario que deposite antes de que pueda retirarse en csgolive?",faq_deposit_before_withdraw_body:"Si usted debe comprar $ 5 de crédito con PayPal o skfpay para permitir la retirada..",faq_case_price_changed_head:"¿Por qué el precio de mi caja cambió?",faq_case_price_changed_body:"Actualizamos los precios de las skins todos los días y esto puede provocar que el precio de las cajas cambien, a medida que el precio de su caja depende de las skins que contiene..",faq_sponsoring_head:"¿Cómo puedo estar patrocinado por csgolive?",faq_sponsoring_body:"Si usted es un usuario de YouTube con al menos 20.000 subs o 10.000 vistas por vídeo envíe un email con el nombre de su canal para partnerships@csgolive.com y decir que está interesado!",faq_prov_fair_tech_head:"¿Cómo funciona el demonstrablemente honesto? (versión técnica)",faq_contact_support_head:"¿Puedo hablar con alguién en csgolive? Mis preguntas no fueron contestadas.",faq_contact_support_body:"No dude en enviar un email a support@csgolive.com!",nav_bar_case_browser:"Navegador de cajas",nav_bar_history:"Historico",logout:"Salir",profile:"Perfil",chat_rules_title:"Reglas de Chat",chat_rules_intro:"Al usar el chat, aceptas las siguientes reglas. Cuando no mantenga las reglas, un mod o un administrador podría prohibirle temporalmente o permanentemente desde nuestras salas de chat.",chat_rules_1:"#1 No vincule su código de afiliado.",chat_rules_2:"#2 No molestar ni insultar a los demás.",chat_rules_3:"#3 No vincule otros sitios de skins de CS:GO.",chat_rules_4:"#4 No pida ayuda en el chat o solicite recargas en skins. Todas las consultas relacionadas con el soporte deben ser enviadas a support@csgolive.com",chat_rules_5:"#5 No envíe spam de sus casos personalizados y no utilice ningún tipo de aplicación de terceros para vincular sus casos en el chat.",chat_rules_6:"#6 No pida skins/dinero.",chat_rules_7:"#7 No insulte.",chat_rules_8:"#8 No le diga que ván a su perfil y observe sus casos.",chat_rules_icons:"Iconos de chat",chat_rules_deposit:"Depositado",inventory_login:"Esta página estará disponible una vez que inicie sesión.",inventory_show_settings:"Ajustes de la presentación",inventory_failed:"Error al cargar inventario...",inventory_none:"No tiene items en su inventario...",case_creator_login:"Inicia sesión para crear una caja",cases_confirm_case_price_total:"Total",feature_case_title:"Divulgar sus cajas!",feature_case_24h:"24 Horas",feature_case_3d:"3 Dias",feature_case_1w:"1 Semana",feature_case_1m:"1 Mes",feature_case_length_label:"Termo",feature_case_total_price:"Precio total",feature_case_explanation_title:"¿Como funciona?",feature_case_explanation_line_1:"Puede divulgar una caja cuando la misma cuesta más que $1 (excluyendo la taxa de afiliado) y contiene al menos 4 items.",feature_case_explanation_line_2:"Cuando compra una caja divulgada, la misma sera agregada a la rotación de cajas divulgadas.",feature_case_explanation_line_3:"La rotación de cajas divulgadas possue tiene máximo de 120 cajas, esto significa que en el peor de los casos, su caso se mostrará en el 10% de las visitas a la página.",feature_case_explanation_line_4:"Nota: si divulga una caja que contiene su código de afiliado o blasfemia en el título, se eliminará sin reembolso.",feature_case_purchase:"Comprar!",case_flip_title:"Case Flips",case_flip_data_title:"Datos de Case Flip",case_flip_cancel_head:"Confirmar cancelación",case_flip_cancel_body:"Por favor, confirme que desea cancelar este Case Flip.",case_flip_cancel_flip:"Cancelar Flip",case_flip_does_not_exist:"Case flip ya no existe.....",history_login:"Inicia sesión para ver tu histórico",history_withdraw_status_0:"Sin procesar",history_withdraw_status_1:"Pendiente de confirmación",history_withdraw_status_2:"Enviado (confirmado)",history_withdraw_status_3:"Terminado",history_withdraw_status_4:"Items devueltos",history_withdraw_status_5:"Rechazado por el usuario",history_withdraw_status_6:"Fallado",history_withdraw_status_7:"Rechazado por CS:GO Live",history_withdraw_status_8:"Expirado",history_withdraw_status_9:"Falló la Autenticación Móvil",nav_bar_daily_free_case:"Caja diaria gratis",cases_stop_spin:"Saltar Animación",bonus_refresh_bonus:"Actualizar Bonus",scam_warning_message:"Cualquier persona que intenta agregarle y pedir sus skins es un golpista. Ningún administrador / mod de CSGOLive te agregará en steam y pedirá tus skins. Puede verificar nuestro twitter y grupo del steam en la parte inferior izquierda de la página",scam_warning_understand:"Entiendo",scam_warning_title:"Advertencia de golpes",bid_confirm_head:"Confirmar oferta",bid_confirm_body:"Por favor, confirme que desea hacer una oferta.",bid_confirm_confirm:"Confirmar",bid_confirm_close:"Cerrar",bid_confirm_amount:"Valor de la oferta:",bid_cases:"Cajas de oferta",bid_cases_bid:"Ofertar",bid_cases_empty_slot:"Espacio vacío",bid_cases_