duct:"Produkt",history_transaction_amount:"Ilość",history_transaction_description:"Opis",history_transaction_email:"Email",history_page:"Strona",support_contact_us_head:"Masz pytanie, którego nie ma w FaQ?",support_contact_us_body:"Nie wachaj się pisać do nas, jeżeli coś jest nie jasne, masz jakąkolwiek uwage lub pytanie.",support_contact_us:"Skontaktuj się z nami",faq_head:"Najczęściej Zadawane Pytania",faq_deposit_failed_head:"Mój depozyt za pomocą skina nie udał się, co powinienem zrobić?",faq_deposit_failed_body:"Jeżeli zdepozytowałeś za pomocą SKF Pay, musisz mieć otwartą stronę, aż do momentu przekierowania. W innym wypadku nie możemy przetworzyć Twojego depozytu.",faq_deposit_failed_solution:"Rozwiązanie:",faq_deposit_failed_solution_step_1:"Przejdź SKFpay.com",faq_deposit_failed_solution_step_2:"Po zalogowaniu, sprawdź czy nie ma balansu do zebrania na 'Summary Page'. Zbierz go.",faq_deposit_failed_solution_step_3:"Otwórz 'Activity Page' i anuluj oczekujące transakcje. Dzięki temu otrzymasz zwrot transakcji",faq_deposit_failed_solution_step_4:"Przejdź na naszą stronę i spróbuj zdepozytować ponownie, tylko tym razem wybierz opcję 'deposit with balance' na stronie skfpay.",faq_valve_cases_head:"Czy są to te same skrzynki, które oferuje valve?",faq_valve_cases_body:"Nie. Sami wybraliśmy skiny, żeby otwieranie skrzynek było ciekawsze niż to co oferuje valve, bądź jakakolwiek inna strona.",faq_withdraw_status_head:"Gdzie mogę śledzić status wypłaconego przedmiotu?",faq_withdraw_status_body:"Wypłaty mogą być śledzone poprzez wejscie w 'historię' z głównego menu, następnie wystarczy kliknąć 'wypłaty'.  .",faq_open_cases_head:"Jak mogę otworzyć skrzynki na csgolive?",faq_open_cases_body:"Naciśnij 'Dodaj Fundusze' po lewej stronie, następnie użyć G2APAY żeby doładować konto za pomocą gotówki, lub SKFPAY, żeby doładować konto skinami! Potem przejdź do jakiejkolwiek skrzynki, na która Ciebie stać i naciśnij 'Otwórz skrzynkę'!",faq_skin_colors_head:"Co oznaczają kolory wokół przedmiotów i czy oznaczają co innego niż kolory valve?",faq_skin_colors_body:"Kolory oznaczają różnicę pomiędzy ceną przedmiotu, a skrzynki. Tak więc skin z żółtą obramówką ma o wiele większą wartość niż cena skrzynki.",faq_skin_wears_head:"Czemu nie macie stanów wszystkich broni (na przykład Bagnet| Miejski zamaskowany (Fabrycznie Nowy)?",faq_skin_wears_body:"Nie wszystkie stany broni są dostępne ponieważ mogą być one rzadkie i ciężkie to uzupełnienia.",faq_case_creator_head:"Jak działa tworzenie własnej skrzynki?",faq_case_creator_body:"W 'Kreatorze Skrzynek' możesz wybrać skiny i procenty, które chciałbyś miec we własnej skrzynce. My automatycznie liczymy wartość skrzynki na podstawie statystyk oraz spodziewanej wygranej. Możesz dodać swój podatek i czerpać korzyści, jeżeli ktoś otworzy Twoją skrzynkę. Możesz również promować swoją skrzynkę na 24 godziny poprzez zapłacenie 10$. To umieści Twoją skrzynkę na głównej stronie, tuż pod oficjalnymi skrzynkami.",faq_rigged_head:"Czy wasza strona jest oszukana?",faq_rigged_body:"Procenty na CSGOLive są lepsze niż jakiejkolwiek inne stronie. Jeżeli nie lubisz naszych skrzynek, możesz stworzyć swoją własną w 'Kreatorze Skrzynek' i ją otworzyć!",faq_restock_head:"Co oznacza, że przedmiot jest niedostępny, albo że musi być uzupełniony?",faq_restock_body:"Oznacza to, że przedmiot w tej chwili nie jest dostępny. Uzupełniamy nasze przedmioty co 2-3 godziny i staramy się, żeby nasze ekwipunku były zawsze pełne. Jeżeli nie chcesz czekać, aż uzupełnimy dany przedmiot, możesz zawsze wypłacić skina do skfpay, żeby otrzymać równowartość przedmiotu na stronie.",faq_deposit_before_withdraw_head:"Muszę zdepozytować zanim będę mógł wypłacać na csgolive?",faq_deposit_before_withdraw_body:"Tak, musisz zakupić 5$ kredytów na stronie za pomocą G2APAY lub SKFPAY, żeby móc wypłacać przedmioty.",faq_case_price_changed_head:"Czemu cena mojej skrzynki się zmieniła?",faq_case_price_changed_body:"Codziennie aktualizujemy ceny przedmiotów, więc jeżeli cena skrzynki wzrosła, oznacza to, że również wzrosła cena przedmiotu zawartego w skrzynce.",faq_sponsoring_head:"Jak mogę być sponsorowany przez csgolive?",faq_sponsoring_body:"Jeżeli jesteś youtuberem z 20,000 subów, bądź przynajmniej 10,000 wyświetleniami video, wyślij maila na partnerships@csgolive.com z linkiem oraz nazwą do swojego kanału!",faq_prov_fair_tech_head:"Jak działa 'provably fair'? (Wersja techniczna)",faq_contact_support_head:"Moge porozmawiać z kimś z csgolive? Nie znalazłem odpowiedzi na moje pytanie/problem powyżej.",faq_contact_support_body:"Napisz do nas na support@csgolive.com!",nav_bar_case_browser:"Wyszukiwarka Skrzynek",nav_bar_history:"Historia",logout:"Wyloguj się",profile:"Profil",chat_rules_title:"Regulamin chatu",chat_rules_intro:"Używając chatu, akceptujesz następnujący regulamin. Jeżeli nie będziesz przestrzegać zasad, moderator bądź admin, może Ciebie zbanować tymczasowo, a nawet permanentnie.",chat_rules_1:"#1 Nie linkuj swojego kodu referyncyjnego.",chat_rules_2:"#2 Nie obrażaj, ani nie wyzywaj innych.",chat_rules_3:"#3 Nie linkuj/reklamuj innych stron.",chat_rules_4:"#4 Nie pytaj o pomoc, ani o uzupełnienie przedmiotów. Wszystkie takie sprawy są rozwiązywane za pomocą support@csgolive.com",chat_rules_5:"#5 Nie spamuj swoimi niestandardowymi skrzynkami, ani nie używaj innych aplikacji, do wysyłania skrzynek na chacie.",chat_rules_6:"#6 Nie proś o skiny/pieniądze.",chat_rules_7:"#7 Nie przeklinaj.",chat_rules_8:"#8 Nie mów innym, żeby weszli na Twój profil w celu sprawdzenia skrzynek.",chat_rules_icons:"Ikony chatu",chat_rules_deposit:"Deposited",affiliates_your_code:"Twój kod",affiliates_create_code_first:"Stwórz najpierw kod.",affiliates_create_code:"Stwórz kod referencyjny",affiliates_linked_to:"Jesteś połączony z",affiliates_affiliate_code:"Kod referencyjny",affiliates_create:"Stwórz",affiliates_code:"Kod referencyjny",inventory_login:"Ta strona będzie dostępna po zalogowaniu.",inventory_show_settings:"Pokaż opcję",i